inline cFont *NEW_CFONTCALIBRI20()
{
    cImage        *img       = new cImage(CFONTCALIBRI20_WIDTH, CFONTCALIBRI20_HEIGHT, CFONTCALIBRI20_IMAGE_FORMAT);
    unsigned char *bytearray = new unsigned char[CFONTCALIBRI20_IMAGE_SIZE];

    memcpy(bytearray, CFONTCALIBRI20_BYTEARRAY, CFONTCALIBRI20_IMAGE_SIZE);
    img->setData(bytearray, CFONTCALIBRI20_IMAGE_SIZE, true);

    cFont *font = new cFont();
    font->m_charset.m_base       = CFONTCALIBRI20_CHARSET_BASE;
    font->m_charset.m_lineHeight = CFONTCALIBRI20_CHARSET_LINEHEIGHT;
    font->m_charset.m_width      = CFONTCALIBRI20_WIDTH;
    font->m_charset.m_height     = CFONTCALIBRI20_HEIGHT;
    font->m_charset.m_pages      = CFONTCALIBRI20_CHARSET_PAGES;
    for (int i=0; i<256; i++)
    {
        font->m_charset.m_chars[i].m_x        = CFONTCALIBRI20_CHARSET[8*i  ];
        font->m_charset.m_chars[i].m_y        = CFONTCALIBRI20_CHARSET[8*i+1];
        font->m_charset.m_chars[i].m_width    = CFONTCALIBRI20_CHARSET[8*i+2];
        font->m_charset.m_chars[i].m_height   = CFONTCALIBRI20_CHARSET[8*i+3];
        font->m_charset.m_chars[i].m_xOffset  = CFONTCALIBRI20_CHARSET[8*i+4];
        font->m_charset.m_chars[i].m_yOffset  = CFONTCALIBRI20_CHARSET[8*i+5];
        font->m_charset.m_chars[i].m_xAdvance = CFONTCALIBRI20_CHARSET[8*i+6];
        font->m_charset.m_chars[i].m_page     = CFONTCALIBRI20_CHARSET[8*i+7];
    }
    font->m_charset.preProcess();

    font->m_texture->setImage(img);

    return font;
}

